features.script:
let soPlaying = false;

const soundObjects = [
    parcel.getFeatureById("so_B"),
    parcel.getFeatureById("so_F"),
    parcel.getFeatureById("so_C"),
    parcel.getFeatureById("so_R"),
    parcel.getFeatureById("so_L")
];


parcel.on('playerenter', (e) => {
    let visitor = e.player;
    visitor.on('move', (e) => {
        let x = e.position[0];
        let y = e.position[1];
        let z = e.position[2];
        if (y >= 7 && (x >= -6 && x < 2 && z >= -4 && z < 4)) {
            playSoundObjects()
        } else {
            pauseSoundObjects()
        }
    });
})

function pauseSoundObjects() {
    if (!soPlaying) return;

    soundObjects.forEach((object) => {
        object.pause();
    });

    soPlaying = false;
}

function playSoundObjects() {
    if (soPlaying) return;

    soundObjects.forEach((object) => {
        object.play();
    });

    soPlaying = true;
}
